        fontSize: '2rem',
        paddingLeft: '2.5rem'
      }}>Blake Madigan</h1>
      <p style={{
        marginTop:'0',
        marginBottom: '.5rem',
        fontSize: '1.5rem',
        fontWeight: 'bold'
      }}>Full-Stack Developer</p>
      {/* 
      <p class="material-icons" style={{
        marginTop:'0',
        fontSize: '1.5rem',
        fontWeight: 'bold'
      }}>facebook instagram</p>
      */}
      <div className="social">
      <a href="https://www.instagram.com/lordedresdemorte/?hl=en"><i class="fab fa-instagram"></i></a><i class="fab fa-facebook"></i><i class="fab fa-linkedin"></i><i class="fab fa-github"></i>
      </div>
    </div>
  );
}

export default Home;
